import './App.css';
import Navbar from './Navbar';
import Sidebar from './Sidebar';
import Event from './Event';

import ImageCarousel from './ImageCarousel';


const images = [
  'https://blog.openreplay.com/images/elegant-gallery-with-react-responsive-carousel/images/hero.png',
  'https://www.copycat.dev/blog/wp-content/uploads/2022/12/rc.png',
  'https://blog.openreplay.com/images/elegant-gallery-with-react-responsive-carousel/images/hero.png',
  'https://www.copycat.dev/blog/wp-content/uploads/2022/12/rc.png',
  'https://blog.openreplay.com/images/elegant-gallery-with-react-responsive-carousel/images/hero.png',
  'https://www.copycat.dev/blog/wp-content/uploads/2022/12/rc.png',
  'https://blog.openreplay.com/images/elegant-gallery-with-react-responsive-carousel/images/hero.png',
  'https://www.copycat.dev/blog/wp-content/uploads/2022/12/rc.png',
  'https://blog.openreplay.com/images/elegant-gallery-with-react-responsive-carousel/images/hero.png',
  'https://www.copycat.dev/blog/wp-content/uploads/2022/12/rc.png'
];

function App() {
  return (
    <div className="App">

      <Navbar />
      <Sidebar />
      <Event />

      <ImageCarousel images={images} />


    </div>
  );
}

export default App;
